import React from "react";

function Files() {
  return (
    <div className="container">
      <h2>Uploaded Files</h2>
      <p>Browse or view IPFS hosted files linked to identities.</p>
      <p>Example: https://ipfs.io/ipfs/&lt;CID&gt;</p>
    </div>
  );
}

export default Files;
